/*
 * Google Dark Plus
 *
 * Author      : Gene.Zhe 
 * Description : Modifies the colors, logos, and a few other images on Google Web Search (http://www.google.com/)
 * Usage       : Use with the Stylish Firefox extension (http://userstyles.org/) or copy to your Firefox userContent.css file
 */
 
 
@namespace url(http://www.w3.org/1999/xhtml);
 
@-moz-document
  url(http://www.google.com/),
  url-prefix(http://www.google.com/webhp),
  url-prefix(http://www.google.com/search?),
  url-prefix(http://www.google.com/#hl=),
  url-prefix(http://www.google.com/#q=),
  url-prefix(http://images.google.com/webhp),
  url-prefix(http://images.google.com/images),
  url-prefix(http://www.google.com/imghp?),
  url-prefix(http://www.google.com/images),
  url(http://www.google.com/intl/en/),
  url-prefix(http://www.google.com/movies),
 
  url(https://www.google.com/),
  url-prefix(https://www.google.com/webhp),
  url-prefix(https://www.google.com/search?),
  url-prefix(https://www.google.com/#hl=),
  url-prefix(https://www.google.com/#q=),
  url-prefix(https://images.google.com/webhp),
  url-prefix(https://images.google.com/images),
  url-prefix(https://www.google.com/imghp?),
  url-prefix(https://www.google.com/images),
  url(https://www.google.com/intl/en/),
  url-prefix(https://www.google.com/movies),
 
  url(http://www.google.ru/),
  url-prefix(http://www.google.ru/webhp),
  url-prefix(http://www.google.ru/search?),
  url-prefix(http://www.google.ru/#hl=),
  url-prefix(http://www.google.ru/#q=),
  url-prefix(http://images.google.ru/webhp),
  url-prefix(http://images.google.ru/images),
  url-prefix(http://www.google.ru/imghp),
  url-prefix(http://www.google.ru/images),
  url-prefix(http://images.google.ru/webhp),
  url-prefix(http://www.google.ru/movies),
 
  url(http://www.google.ru/),
  url-prefix(http://www.google.ru/webhp),
  url-prefix(http://www.google.ru/imghp),
  url-prefix(http://www.google.ru/search?),
  url-prefix(http://www.google.ru/#hl=),
  url-prefix(http://www.google.ru/#q=),
  url-prefix(http://images.google.ru/webhp),
  url-prefix(http://www.google.ru/movies)
{
 
body {
  background: #262626 url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAE/CAYAAACHEqngAAAABGdBTUEAAK/INwWK6QAAABl0RVh0U29mdHdhcmUAQWRvYmUgSW1hZ2VSZWFkeXHJZTwAAABUSURBVHjaYmJgYPjPBCQYmAiyiFBCBIsSxWSqw8YlUwlOMWpLUFsJmYppbMrAE2B//CPswX94ff5v2AUJfU2hcTagjgR1ShBqF25ULG1JK/kBAgwAT3T9gBTuL/MAAAAASUVORK5CYII=") repeat-x !important;
 
  color: #fff !important;
}
 
/* default link color */
a:link, a:visited, .link, a font[color="#008000"] {
  color: #3399cc !important;
}
 
/* 'Something different' in left navbar */
#leftnav h2{ color: #b9b9b9  !important;}
 
/* hover default link color */
a:hover, .link, a font[color="#008000"] {
text-decoration: underline !important;
  color: #3399cc !important;
}
/* active default link color */
a:active, .link, a font[color="#008000"] {
  color: #30809c  !important;
}
 
/* underlining selected links according to original*/
.l, .gb3, .pn, .gb4, a.gb1:link, a.gb1:visited {text-decoration:underline  !important;}
 
/* Background for sidebar selected item*/
 
.msel {border: none !important; background: none repeat scroll 0% 0% #001e3c !important;}
 
/* default text color */
div, td { color: #c9c9c9 !important; }
 
/* Edit (input) box style */
textarea, input[type="text"], input[type="file"], input[type="search"], input[type="input"], input[type="password"], input[type="hidden"], input[type="input"], input[title="Google Search"], input[title="Search Products"], input[name="q"]
{
  background: rgba(30,30,30,1.0)  url("data:image/png;base64,") repeat-x !important; border-width: 0px !important; -moz-appearance:none!important;}
 
/* Colors of all borders and line separators */
* {border-color: rgba(50,50,50,1.0) !important; text-decoration: none !important;}
 
/* 'Select color' block in Images Search */
.sc {background: #262626 !important; }
 
/* Fix for 'Showing results for... Search instead for...' */
.tl b, #rpro b, #ap a, #adv-search nobr, #preferences nobr, #safe-preferences nobr, #report nobr, a span, .link, #trafficcontrol div, #lyrc div, #hmtctl div{color: #3399cc !important;}
.vlim-domain, span{color: #c9c9c9 !important;}
 
/* Fix for links in green URL text */
.bc, .f a {color: #5dbe5a !important;}
 
/* UPDATED by Ixo 06/05/10 - fix for fade-in effect on front page */ #gog, #leftnav, .nojsb, .med, #gbar, #fctr, #fmsg, #ghead, #sbl, .promo, .fade { background: transparent !important; }
 
#rgsh_s {  background: #262626 !important;  }
 
/*Updates for Google images since 21.07.10*/
 
/* Images header fix
----------------------------------------------*/
.lhshdr, .rshdr, .tpblk, .tphdr, #tbbcc, #rgsh{
  background: #262626 url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAE/CAYAAACHEqngAAAABGdBTUEAAK/INwWK6QAAABl0RVh0U29mdHdhcmUAQWRvYmUgSW1hZ2VSZWFkeXHJZTwAAABUSURBVHjaYmJgYPjPBCQYmAiyiFBCBIsSxWSqw8YlUwlOMWpLUFsJmYppbMrAE2B//CPswX94ff5v2AUJfU2hcTagjgR1ShBqF25ULG1JK/kBAgwAT3T9gBTuL/MAAAAASUVORK5CYII=") repeat-x !important;
}
 
/* Image mouseover box fix
----------------------------------------------*/
.rg_hv{
  background-color: #262626 !important;
 
}
 
/* Background for loading images*/
.rg_l {background: #444 !important;}
 
 
/* Top Nav Bar Fixes
----------------------------------------------*/
#guser{
  background:#262626 url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAE/CAYAAACHEqngAAAABGdBTUEAAK/INwWK6QAAABl0RVh0U29mdHdhcmUAQWRvYmUgSW1hZ2VSZWFkeXHJZTwAAABUSURBVHjaYmJgYPjPBCQYmAiyiFBCBIsSxWSqw8YlUwlOMWpLUFsJmYppbMrAE2B//CPswX94ff5v2AUJfU2hcTagjgR1ShBqF25ULG1JK/kBAgwAT3T9gBTuL/MAAAAASUVORK5CYII=") repeat-x !important;
  border-bottom:1px solid #444 !important;
  width:100% !important;
  margin-top: -1px !important;
}
 
#guser nobr{
 margin-right: 2px !important;
 color: #c9c9c9 !important;
}
 
 
/* Google bar "menu" and Google Suggest
---------------------------------------*/
#gbi, #gbg, .gac_m, .fade {
  background: #262626 !important;
  border-color: #000 !important;
  -moz-box-shadow: 4px 4px 10px rgba(0,0,0, 0.5) !important;
}
 
/* 16/06 Changes, fix for new google implementations
-----------------------------------------------------*/
 
#prm { opacity: 0 !important; width: 0px !important; height: 0px !important; }
#cpf { opacity: 0 !important; width: 0px !important; height: 0px !important; }
 
a.gb2:hover,
.gac_b .gac_c,
.gac_b .gac_d {   
  background: #333!important;
}
 
.gbd { border-color: #000 !important; }
.gbh { border: none !important; }
 
.gac_c  { font-size: 0.8em  !important; }
.gac_a > .gac_c { font-size: 0.8em  !important;  color: #c9c9c9 !important; }
 
.gac_d, .gac_e {color: rgba(255,255,255,0.5) !important; }
 
/* ad URL */
.gac_h { color: #ccc !important; }
 
.mitem { color: #c9c9c9 !important; }
 
li.mitem msel { color: #fff !important; }
 
/* Search results
-----------------*/
/* big link */
#res .g .r a {text-decoration: underline !important;
  color: #0099d0 !important;
}
 
/* big link visited */
#res .g a:visited {
  opacity: 0.6 !important;
}
 
/* big link active */
#res .g a:active {
  color: #30809c !important;
}
 
/* link description */
#res .g .s {
  color: #c9c9c9 !important;
}
 
/* URL text */
.a, cite, .cite, .cite:link {
  color: #5dbe5a !important;
}
 
/* cached and similar links */
#res .g .s .gl a {
  color: #80b9ce !important;
}
 
.gl a {
  color: #80b9ce !important;
}
 
/* dashes between Cached and Similar links */
.gl { color: #c9c9c9 !important; }
 
/* visited cached and similar links */
#res .g .s .gl a:visited {
  opacity: 0.6 !important;
}
 
/* hover cached and similar links */
#res .g .s .gl a:hover {
text-decoration: underline !important;
  color: #80b9ce !important;
}
 
/* active cached and similar links */
#res .g .s .gl a:active {
  color: #669999 !important;
}
 
/* sub page links (on first link result) */
#res .slk a {
  color: #3399cc !important;
}
 
/* visited sub page links  */
#res .slk a:visited {
  opacity: 0.5 !important;
}
 
/* active sub page links  */
#res .slk a:active {
  color: #30809c !important;
}
 
/* additinal links color ('Quick View' etc) */
a.fl:link {color: #80b9ce !important;}
a.fl:visited {color: #80b9ce !important; opacity: 0.6 !important;}
a.fl:active {color: #669999!important;}
 
/* footer links color */
#fll a:link {color: #80b9ce !important;}
#fll a:visited {color: #80b9ce !important; opacity: 0.6 !important;}
#fll a:active {color: #669999!important;}
 
/* Image search footer links color */
#bfl a:link {color: #80b9ce !important;}
#bfl a:visited {color: #80b9ce !important; opacity: 0.6 !important;}
#bfl a:active {color: #669999!important;}
 
/* more line spacing on descriptions */
#res .s { line-height: 1.4 !important; }
 
/* image thumbnails */
#res .g img {
  border: none !important;
  -moz-box-shadow: 4px 4px 10px rgba(0,0,0,0.4) !important;
}
 
/* File type (ex: [PDF]) next to link */
.g .w { color: #0099d0!important; }
 
/* "File Format" */
.f { color: #b9b9b9 !important;}
 
 
/* "video results" time info */
#res .g .ts font[color="#666666"] {
  color: #ffc !important;
}
 
/* "more options" */
.tbo #tbd {
  background: transparent !important;
  border-color: #666 !important;
}
 
/* Related searches bar */
#tbt5 {
  background: #3e3e3e url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAACJCAMAAADaKKIOAAAABGdBTUEAAK/INwWK6QAAABl0RVh0U29mdHdhcmUAQWRvYmUgSW1hZ2VSZWFkeXHJZTwAAAAwUExURT4+Pi8vLzY2NjExMT09PTU1NTIyMjQ0NDAwMDo6Ojs7Ozg4ODk5OTc3Nzw8PDMzM9RYRnEAAAA0SURBVHjajMHHDQAgDASw0Dvsvy28IhQuEjYZyqDjUVzK9Ayi5UPdwA4WsILzo78eW4ABAJG4BRc8hKcNAAAAAElFTkSuQmCC) repeat-x !important;
  border-color: rgba(128,128,128,0.1) !important;
}
 
/* source code listing */
#res tt { color: #fff !important; }
 
 
/* Ads
------*/
#mbEnd, #tads { background: rgba(128,128,128,0.2) !important; }
 
#mbEnd {
  border-left: 1px solid transparent !important;
}
 
/* hide search result ads (delete next line if you want them) */
#mbEnd, #tads { display: none !important; }
 
/* Google Suggest ads */
.gac_n { display: none !important; }
 
 
/* Bars
-------*/
 
/* center notice bar */
#tbbc {background:  rgba(100,100,100,0.2) !important; }
 
#siss {background:  rgba(100,100,100,0.2) !important; }
 
/* results bar */
#ssb,
form[action="/movies"] tr[bgcolor="#e5ecf9"],
#canvas > .heading  {
  background: #353535 url(data:image/png;base64,) repeat-x !important;
  border-top-color: #666 !important;
}
 
/* big bar after bottom pager */
#bsf,
#navbar + br + table td[bgcolor="#e5ecf9"] {
  background: #3d3d3d url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAgAAABkCAMAAACM54GYAAAABGdBTUEAAK/INwWK6QAAABl0RVh0U29mdHdhcmUAQWRvYmUgSW1hZ2VSZWFkeXHJZTwAAAAhUExURUFBQUNDQ0dHR0JCQkZGRkREREVFRUhISEBAQD8/Pz4+PiuYN8EAAAA4SURBVHja7Ma3DQAgEATBx5v+CybZ+PRAhMREYw22lQiVDJUKVwpcCVBJUBE6DjNwm4mfR7MEGADMDhfpQgIrygAAAABJRU5ErkJggg==) repeat-x !important;
  border-top-color: #555 !important;
  border-bottom-color: #444 !important;
}
 
/* hide borders */
.k { background: none !important; }
 
/* hide old pager images */
#navbar td img { visibility: hidden !important; }
 
 
 
/* Replacement images
---------------------*/
/* big logo */
 
 
 
img[src="logos/"], img[src$="logo.gif"], img[src$="images_logo_lg.gif"], img[src$="logo1w.png"], img[src$="classicplus.png"], div[style*="logo1w.png"], div[style*="logo_plain.png"], img[src$="logo_google_suggest.gif"], img[src$="ssl_logo_lg.gif"], img[src^="logos/holiday"], div[style*="logo_plain2.png"], img[src^="/intl/"][alt="Google"][title="Google"] {
  margin-top: 6% !important;
  width: 0 !important;
  height: 90px !important;
  padding-left: 281px !important;
  background-repeat: no-repeat !important;
  background-image: url("data:image/png;base64,") !important;
}
 

/* Google SSL small logo */
img[src="logos/"], img[src$="ssl_logo_beta_49.gif"], div[style*="ssl_logo_beta_49.gif"], img[src^="/intl/"][alt="Google"][title="Google"] {
  margin-top: 6% !important;
  width: 0 !important;
  height: 49px !important;
  padding-left: 138px !important;
  background-repeat: no-repeat !important;
  background-image: url("data:image/gif;base64,") !important;
}


/* "nav" sprite sheet */
.w10, .w11, .w20, .w21, .w24, .wci, .wpb, .w4, .w5, .w40, .w41, .w44, .w50, .w51, .w54, li.w0 .w5, li.w1 .w5,
.csb, .ss, .micon,
#header a#logo,
.tbi div, #tbp,
a#logo > img {
  background-image: url("data:image/png;base64,") !important;
}
 
/* small logo */
a#logo > img {
  width: 0 !important;
  height: 106px !important;
  padding-left: 164px !important;
}
 
 
/* Hide small logo text link, and intl text name */
a#logo, #lgpd + div > div[style^="color: rgb(102, 102, 102); font-size: 16px"] { font-size: 0 !important; }
a#logo, #lgpd + div > div[style^="color: rgb(119, 119, 119); font-size: 16px"] { font-size: 0 !important; }
#logo > div { font-size: 0 !important; }
 
 
}
